import React, { Component } from "react";
import "./App.css";
import Navbar from "./Navbar";
import Search from "./Search";
import Carousel from "./Carousel";
import List from "./List";
import Map from "./Map";

//<Carousel />
class Main extends Component {
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="Main-Area">
          <Search />
        </div>
        <div>
          <List />
        </div>
      </React.Fragment>
    );
  }
}

export default Main;
